svg.script:
var $ = top.$;
var	trays_number = 16,
	cntnr_cells = document.getElementById("cntnr_cells"),
	traySubscription,
	racknode;

webMI.addOnload(function() {

	console.log("- - - Loading rack view - - -");
	webMI.trigger.fire("RequestRackNode");
	webMI.trigger.connect("RackSelect", function(a){
		var RackSelected = a.value;
	});

	for (var i = 1; i <= 16; i++) {
		var id = document.getElementById(i);
		webMI.addEvent(id, ["click","touchend"], function(e) {

			webMI.gfx.setVisible(cntnr_cells, true);
			var traySelected = this.id;
//			$(cntnr_cells).toggle("drop", 500);
			console.log("Tray "+this.id+" selected");
			if (racknode != undefined){

				var writeDP = "/" + racknode.TaskName + "/.SamsungCommands[" + racknode.Index + "].TrayRequest[" + racknode.RackNumber + "]";
//				console.log("Writing "+this.id+" to ", writeDP);
				var writeOutput = webMI.data.write([writeDP], [this.id]);
	//			console.log("result of write", writeOutput);
				webMI.data.unsubscribe(traySubscription);
				var trayDPs = [
					racknode.DataDP + ".Tray.CurrentTray",
					racknode.DataDP + ".TrayDetails.Temp01",
					racknode.DataDP + ".TrayDetails.Temp02",
					racknode.DataDP + ".TrayDetails.Temp03",
					racknode.DataDP + ".TrayDetails.Temp04",
					racknode.DataDP + ".TrayDetails.Temp05",
					racknode.DataDP + ".TrayDetails.Temp06",
					racknode.DataDP + ".TrayDetails.Temp07",
					racknode.DataDP + ".TrayDetails.Temp08",
					racknode.DataDP + ".TrayDetails.Volt01",
					racknode.DataDP + ".TrayDetails.Volt02",
					racknode.DataDP + ".TrayDetails.Volt03",
					racknode.DataDP + ".TrayDetails.Volt04",
					racknode.DataDP + ".TrayDetails.Volt05",
					racknode.DataDP + ".TrayDetails.Volt06",
					racknode.DataDP + ".TrayDetails.Volt07",
					racknode.DataDP + ".TrayDetails.Volt08",
					racknode.DataDP + ".TrayDetails.Volt09",
					racknode.DataDP + ".TrayDetails.Volt10",
					racknode.DataDP + ".TrayDetails.Volt11",
					racknode.DataDP + ".TrayDetails.Volt12",
					racknode.DataDP + ".TrayDetails.Volt13",
					racknode.DataDP + ".TrayDetails.Volt14",
					racknode.DataDP + ".TrayDetails.Volt15",
					racknode.DataDP + ".TrayDetails.Volt16"
				];

				var traySubscription = webMI.data.subscribeBlock(trayDPs, function(e){

//					console.log("Tray Data Details: ", e);					
					var currentTray = e[0].value,
						Temp = [];
					for (var i = 0; i<8; i++){
	                    Temp.push(e[i+1].value);
					}
					var Volt = [];
					for (var i = 0; i<16; i++){
	                    Volt.push(e[i+9].value);
					}

                    // Cells Container                    
                    webMI.gfx.setText("txt_trayNumber", "Tray "+traySelected);

					for (var i = 1; i <= 8; i++) {
						var cellTempId = "txt_tempcell"+i;
							webMI.gfx.setText(cellTempId, Temp[i-1].toFixed(2)+" °C");
							webMI.callExtension("SYSTEM.LIBRARY.PROJECT.QUICKDYNAMICS.Theme", {"action":"font family", "defaultValue":"font family", "id":"txt_tempcell"+i, "key":"FontFamily", "property":""});

					}
					for (var i = 1; i <= 16; i++) {
						var cellVoltId = "txt_cell"+i;                    
						webMI.gfx.setText(cellVoltId, Volt[i-1].toFixed(2)+" V");
						webMI.callExtension("SYSTEM.LIBRARY.PROJECT.QUICKDYNAMICS.Theme", {"action":"font family", "defaultValue":"font family", "id":"cell_"+ii, "key":"FontFamily", "property":""});
						webMI.callExtension("SYSTEM.LIBRARY.PROJECT.QUICKDYNAMICS.Theme", {"action":"font family", "defaultValue":"font family", "id":"txt_cell"+i, "key":"FontFamily", "property":""});
					}

				});
			}
		});
	}
});

webMI.addEvent("box_tray", ["click","touchend"], function(e) {
webMI.gfx.setVisible(cntnr_cells, false);
});
webMI.addEvent("close_click", ["click","touchend"], function(e) {
webMI.gfx.setVisible(cntnr_cells, false);
});



webMI.trigger.connect("SendRackNode", function(e){

//	console.log("Received rack node", e);
	racknode = e.value;

	var rackDPs = [
		racknode.DataDP + ".Rack.RackVoltage",
		racknode.DataDP + ".Rack.SOC",
		racknode.DataDP + ".Rack.SOH",
		racknode.DataDP + ".RackDetails.MaxTempRack",
		racknode.DataDP + ".RackDetails.MinTempRack",
		racknode.DataDP + ".RackDetails.MaxTempTrayID",
		racknode.DataDP + ".RackDetails.MinTempTrayID",
		racknode.DataDP + ".RackDetails.MaxVoltageRack",
		racknode.DataDP + ".RackDetails.MinVoltageRack",
		racknode.DataDP + ".RackDetails.MaxVoltageTrayID",
		racknode.DataDP + ".RackDetails.MinVoltageTrayID"
	]
	webMI.data.subscribeBlock(rackDPs, function(g){

//		console.log("Rack Data: ", g);
		var voltage = g[0].value,
			soc = g[1].value,
			soh = g[2].value,
			maxTemp = g[3].value,
			minTemp = g[4].value,
			maxTempTrayID = g[5].value,
			minTempTrayID = g[6].value,
			maxVoltage = g[7].value,
			minVoltage = g[8].value,
			maxVoltageTrayID = g[9].value,
			minVoltageTrayID = g[10].value;

		//update items
        webMI.gfx.setText("txt_stateCharge", "State of Charge: "+soc.toFixed(2)+" %");
        webMI.gfx.setText("txt_stateHealth", "State of Health: "+soh.toFixed(2)+" %");
        webMI.gfx.setText("txt_rackTemp"," "+ maxTemp.toFixed(2)+" °C");
        webMI.gfx.setText("txt_rackVolt"," "+ voltage.toFixed(2)+" V");

        // Fill in rack information        
		for (var i=1; i<=16; i++){
			var tempText = "       ",
				voltText = "       ";
			if (maxTempTrayID == i) {
				webMI.gfx.setVisible("maxtemp_tray"+i, true);
				tempText = maxTemp.toFixed(2)+" °C";
			} else {
				webMI.gfx.setVisible("maxtemp_tray"+i, false);
			}

			if (minTempTrayID == i) {
				webMI.gfx.setVisible("mintemp_tray"+i, true);
				tempText = minTemp.toFixed(2)+" °C";
			} else {
				webMI.gfx.setVisible("mintemp_tray"+i, false);
			}


			if (maxVoltageTrayID == i) {
				webMI.gfx.setVisible("maxvolt_tray"+i, true);
				voltText = maxVoltage.toFixed(2)+" V";
			} else {
				webMI.gfx.setVisible("maxvolt_tray"+i, false);
			}

			if (minVoltageTrayID == i) {
				webMI.gfx.setVisible("minvolt_tray"+i, true);
				voltText = maxVoltage.toFixed(2)+" V";
			} else {
				webMI.gfx.setVisible("minvolt_tray"+i, false);
			}

			webMI.gfx.setText("txt_tray"+i,"   " + tempText + " |    " + voltText);
			webMI.callExtension("SYSTEM.LIBRARY.PROJECT.QUICKDYNAMICS.Theme", {"action":"font family", "defaultValue":"font family", "id":"tray_"+i, "key":"FontFamily", "property":""});
			webMI.callExtension("SYSTEM.LIBRARY.PROJECT.QUICKDYNAMICS.Theme", {"action":"font family", "defaultValue":"font family", "id":"txt_tray"+i, "key":"FontFamily", "property":""});

		}
	});	

});
